import "./index.css";
import ExpenseItem from './components/ExpenseItem'

export default function App() {
  const expenses=[
   { title:"school rented",price:190.0,date: new Date(2021,2,3)},
    { title:"plot rented",price:180.0,date: new Date(2021,2,3)},
    { title:"mortor rented",price:200.0,date: new Date(2021,2,3)},
    { title:"house rented",price:40.0,date: new Date(2021,2,3)},
  ]
   return (
     <div>
   <ExpenseItem
   title={expenses[0].title}
   price={expenses[0].price}
   date={expenses[0].date}
   > </ExpenseItem>
   <ExpenseItem 
   title={expenses[1].title}
   price={expenses[1].price}
   date={expenses[1].date}

   > </ExpenseItem>
   <ExpenseItem
   title={expenses[2].title}
   price={expenses[2].price}
   date={expenses[2].date}

   > </ExpenseItem>
   </div>

  );
}
